-noshow:yes;\n	mso-style-link:\"Balloon Text Char\";\n	margin:0in;\n	margin-bottom:.0001pt;\n	mso-pagination:widow-orphan;\n	font-size:9.0pt;\n	font-family:\"Lucida Grande\";\n	mso-fareast-font-family:\"Times New Roman\";\n	mso-bidi-font-family:\"Times New Roman\";}\nspan.CommentTextChar\n	{mso-style-name:\"Comment Text Char\";\n	mso-style-noshow:yes;\n	mso-style-locked:yes;\n	mso-style-link:\"Comment Text\";\n	mso-ansi-font-size:12.0pt;\n	mso-bidi-font-size:12.0pt;\n	font-family:\"Times New Roman\";\n	mso-ascii-font-family:\"Times New Roman\";\n	mso-hansi-font-family:\"Times New Roman\";\n	mso-bidi-font-family:\"Times New Roman\";}\nspan.CommentSubjectChar\n	{mso-style-name:\"Comment Subject Char\";\n	mso-style-noshow:yes;\n	mso-style-locked:yes;\n	mso-style-parent:\"Comment Text Char\";\n	mso-style-link:\"Comment Subject\";\n	mso-ansi-font-size:12.0pt;\n	mso-bidi-font-size:12.0pt;\n	font-family:\"Times New Roman\";\n	mso-ascii-font-family:\"Times New Roman\";\n	mso-hansi-font-family:\"Times New Roman\";\n	mso-bidi-font-family:\"Times New Roman\";\n	font-weight:bold;}\nspan.BalloonTextChar\n	{mso-style-name:\"Balloon Text Char\";\n	mso-style-noshow:yes;\n	mso-style-locked:yes;\n	mso-style-link:\"Balloon Text\";\n	mso-ansi-font-size:9.0pt;\n	mso-bidi-font-size:9.0pt;\n	font-family:\"Lucida Grande\";\n	mso-ascii-font-family:\"Lucida Grande\";\n	mso-hansi-font-family:\"Lucida Grande\";\n	mso-bidi-font-family:\"Times New Roman\";}\nspan.GramE\n	{mso-style-name:\"\";\n	mso-gram-e:yes;}\n@page Section1\n	{size:594.95pt 841.9pt;\n	margin:1.0in 1.25in 1.0in 1.25in;\n	mso-header-margin:35.4pt;\n	mso-footer-margin:35.4pt;\n	mso-paper-source:0;}\ndiv.Section1\n	{page:Section1;}\n-->\n</style>\n<!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin:0in;\n	mso-para-margin-bottom:.0001pt;\n	mso-pagination:widow-orphan;\n	font-size:10.0pt;\n	font-family:\"Times New Roman\";\n	mso-ansi-language:#0400;\n	mso-fareast-language:#0400;\n	mso-bidi-language:#0400;}\n</style>\n<![endif]--><!--[if gte mso 9]><xml>\n <o:shapedefaults v:ext=\"edit\" spidmax=\"11266\"/>\n</xml><![endif]--><!--[if gte mso 9]><xml>\n <o:shapelayout v:ext=\"edit\">\n  <o:idmap v:ext=\"edit\" data=\"1\"/>\n </o:shapelayout></xml><![endif]-->\n</head>\n\n<body lang=EN-US style=\'tab-interval:.5in\'>\n\n<div class=Section1>\n\n<p class=MsoNormal><b style=\'mso-bidi-font-weight:normal\'>Dear participant,<o:p></o:p></b></p>\n\n<p class=MsoNormal>Thank you for volunteering to participate in the Geo Game\nexperiment.</p>\n\n<p class=MsoNormal>In this experiment, we ask you to play a game: the goal is\nto travel to places in order to find precious items. You will be shown a map with\nseveral locations (see below), and roads connecting them. Displayed below the\nmap is the current item that you need to find. Your current location on the map\nis marked by a blue dot. Clicking on a city that is directly connected to your\nlocation allows you to travel there. You can move the map around by dragging\nwith the mouse, and there are buttons on the top right to zoom in (+) and out\n(-), and to center on your current location (o).</p>\n\n<p class=MsoNormal>Each city has different items (including possibly none)\navailable: those are shown on the left for the current city. To pick up your\nitem, click on the &quot;Get&quot; button next to it. You will then be shown\nthe next item to find. You will receive points for each item you find. You goal\nis to get as many points as possible. </p>\n\n<p class=MsoNormal>Because there are many cities, and traveling takes time, you\nneed to use all the help you can get to find the items. Luckily, <b\nstyle=\'mso-bidi-font-weight:normal\'>you are not alone</b>. Other players are\nplaying the game with you, and they also have to find items. Your objective is\nnot just to find your own items - it is also to help your team find items, as\nyour team will help you. You will receive partial credit for items found by\nother members of your team.</p>\n\n<p class=MsoNormal><!--[if gte vml 1]><o:wrapblock><v:shapetype id=\"_x0000_t75\"\n  coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\" path=\"m@4@5l@4@11@9@11@9@5xe\"\n  filled=\"f\" stroked=\"f\">\n  <v:stroke joinstyle=\"miter\"/>\n  <v:formulas>\n   <v:f eqn=\"if lineDrawn pixelLineWidth 0\"/>\n   <v:f eqn=\"sum @0 1 0\"/>\n   <v:f eqn=\"sum 0 0 @1\"/>\n   <v:f eqn=\"prod @2 1 2\"/>\n   <v:f eqn=\"prod @3 21600 pixelWidth\"/>\n   <v:f eqn=\"prod @3 21600 pixelHeight\"/>\n   <v:f eqn=\"sum @0 0 1\"/>\n   <v:f eqn=\"prod @6 1 2\"/>\n   <v:f eqn=\"prod @7 21600 pixelWidth\"/>\n   <v:f eqn=\"sum @8 21600 0\"/>\n   <v:f eqn=\"prod @7 21600 pixelHeight\"/>\n   <v:f eqn=\"sum @10 21600 0\"/>\n  </v:formulas>\n  <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\"/>\n  <o:lock v:ext=\"edit\" aspectratio=\"t\"/>\n </v:shapetype><v:shape id=\"_x0000_s1026\" type=\"#_x0000_t75\" style=\'position:absolute;\n  margin-left:10.8pt;margin-top:0;width:510.8pt;height:286pt;z-index:1;\n  visibility:visible;mso-position-vertical:top\'>\n  <w:wrap type=\"topAndBottom\"/>\n </v:shape><![endif]--><![if !vml]><span style=\'mso-ignore:vglayout\'>\n <table cellpadding=0 cellspacing=0>\n  <tr>\n   <td width=14 height=0></td>\n  </tr>\n  <tr>\n   <td></td>\n   <td><img width=681 height=381\n   src=\"InstructionsImage2.jpg\" v:shapes=\"_x0000_s1026\"></td>\n  </tr>\n </table>\n </span><![endif]><!--[if gte vml 1]></o:wrapblock><![endif]--><br\nstyle=\'mso-ignore:vglayout\' clear=ALL>\nYou can help your team by <b style=\'mso-bidi-font-weight:normal\'>exchanging\ninformation</b> with some of the other players on the right hand side of the\nscreen. At the top right is a limited window of past messages from your team.\nIn the bottom right window, you may <b style=\'mso-bidi-font-weight:normal\'>type\nmessages</b> (press the &quot;Send&quot; button, or, the Enter key to send\nthem). Note that you cannot talk to all of the members of your team. However,\nthe same players will see and respond to your messages throughout the game. In\naddition, the players you can talk to may be able to reach other players. So,\nby forming a chain, it may be possible to pass information along. For example,\nyou can ask the players to inquire about an item, and get back to you if they\nhear back about it.</p>\n\n<p class=MsoNormal>Typically, you will exchange information about two things:\nwhere certain items are available, and whether some roads are particularly slow\nor fast. Exchanging such information is a good thing for you, because you will\nbe rewarded not just for finding your own items: <b style=\'mso-bidi-font-weight:\nnormal\'>you also receive points whenever one of your teammates finds an item</b>.\nThis extends to the people you talk <span class=GramE>to</span> directly via\nmessages, but also to team-members that only they can talk to (you get fewer\npoints when those members find items).<i style=\'mso-bidi-font-style:normal\'><span\nstyle=\'color:red\'><o:p></o:p></span></i></p>\n\n<p class=MsoNormal>As you can imagine, good communication is key to winning\nthis game. You can talk to your team at any time: use the time while you are\nmoving around. It is a good idea to keep moving as much as you can. This allows\nyou to explore cities and find items that you need. Pay close attention to the\nlist of items at each location. You may need to find one of those items later!</p>\n\n<p class=MsoNormal>Do not communicate with other participants except through\nthe messaging window. Do not use any aids to remember things: pen and paper are\nnot allowed!</p>\n\n<p class=MsoNormal>Please ask your experimenter in case you have any questions.</p>\n\n<p class=MsoNormal>Now, go off and travel the world! You have 20 minutes. Have\nfun.</p>\n\n</div>\n\n</body>\n\n</html>\n','I have read these instructions',NULL,0x01,'2010-08-15 22:02:21'),
