ions */\n table.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin:0in;\n	mso-para-margin-bottom:.0001pt;\n	mso-pagination:widow-orphan;\n	font-size:10.0pt;\n	font-family:\"Times New Roman\";\n	mso-ansi-language:#0400;\n	mso-fareast-language:#0400;\n	mso-bidi-language:#0400;}\n</style>\n<![endif]--><!--[if gte mso 9]><xml>\n <o:shapedefaults v:ext=\"edit\" spidmax=\"12290\"/>\n</xml><![endif]--><!--[if gte mso 9]><xml>\n <o:shapelayout v:ext=\"edit\">\n  <o:idmap v:ext=\"edit\" data=\"1\"/>\n </o:shapelayout></xml><![endif]-->\n</head>\n\n<body lang=EN-US style=\'tab-interval:.5in\'>\n\n<div class=Section1>\n\n<p class=MsoNormal style=\'mso-list:none;mso-list-ins:Antonio 20100824T1240\'><b\nstyle=\'mso-bidi-font-weight:normal\'><i style=\'mso-bidi-font-style:normal\'><span\nstyle=\'color:red\'><span class=msoIns><ins cite=\"mailto:Antonio\"\ndatetime=\"2010-08-24T12:40\">Game #1:<o:p></o:p></ins></span></span></i></b></p>\n\n<p class=MsoNormal><b style=\'mso-bidi-font-weight:normal\'><i style=\'mso-bidi-font-style:\nnormal\'><span style=\'color:red\'>The best way to exchange messages is to ask\nyour teammates for information when you need it</span></i></b><i\nstyle=\'mso-bidi-font-style:normal\'><span style=\'color:red\'>, for instance:\n&quot;What\'s the best route to get from <span class=SpellE>Sandefjord</span> to\n<st1:City w:st=\"on\"><st1:place w:st=\"on\">Pittsburgh</st1:place></st1:City>?&quot;,\nor &quot;Where do I find an emerald?&quot; You may also ask them to pass on the\nquestion to others that they can reach. Please make sure you ask only important\nthings that help you find items quickly, and to pass on information that you\nknow is needed.</span></i></p>\n\n</div>\n\n</body>\n\n</html>\n','I have read these instructions',NULL,0x00,'2010-08-24 12:39:00'),
